import React from "react";

const ImageLinkForm = () => {
    return (
		<div>
			<p>The Magic Brain will detect faces in your pictures. Give it a try!</p>
			<div className="outline pa3 ma3 mt0">
				<input className="w-70" type='text' />
				<button className="w-30">Detect</button>
			</div>
		</div>

    );
}

export default ImageLinkForm;
